const express = require('express');
const cors = require('cors');
const mongoose = require('mongoose');
const userRouter = require("./Routers/authRoute");
const quizRouter = require("./Routers/quizRouter");
const Quiz = require('./models/quizModel');
const QuizAnalytics = require('./models/analyticsModel');


require('dotenv').config()

const db_link = process.env.MONGODB_URI;

const app = express();

app.use(cors()) ;
app.use(express.json());

const PORT = process.env.PORT || 4000;

app.listen(PORT, () => {
  console.log(`Server is listening on port ${PORT}`);
});

mongoose
    .connect(db_link)
    .then(function (db) {
    console.log("MongoDB connected successfully");
    })
    .catch(function (err) {
        console.log("Error connecting to MongoDB:", err);
});

app.use("/api/v1/auth", userRouter);
app.use("/api/v1/quiz", quizRouter);


// // Create a new quiz with the timer field omitted
const newQuiz = new Quiz({
    "quizName": "Image Quiz",
    "quizType": "Q&A",
    "optionType": "image",
    "timer": 60,
    "questions": [
      {
        "qNumber": 1,
        "qName": "Which animal is shown in the image?",
        "options": [
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,"
        ],
        "correctOption": "data:image/jpeg;base64,",
      },
      {
        "qNumber": 2,
        "qName": "Which is effil tower in the image?",
        "options": [
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,",
          "data:image/jpeg;base64,"
        ],
        "correctOption": "data:image/jpeg;base64,"
      },
    ],
    refUserId: new mongoose.Types.ObjectId("6648bc840dd4514e9212df46") 
});

newQuiz.save().then(quiz => {
  console.log("Quiz saved successfully:", quiz);
}).catch(err => {
  console.error("Error saving quiz:", err);
});


